Moon (2009)  BluRay-Rip

Verenigd Koninkrijk
Thriller / Science-Fiction
97 minuten

geregisseerd door Duncan Jones
met Sam Rockwell, Kaya Scodelario en de stem van Kevin Spacey

Astronaut Sam Bell (Sam Rockwell) leeft al bijna drie jaar op de maan in opdracht van Lunar Industries. Hij leeft daar een eenzaam bestaan, heeft amper contact met zijn vrouw Tess en driejarige dochter Eve door een defecte satelliet. Zijn enige maatje aan boord is Gerty: een robot. Twee weken voordat hij naar Aarde mag terugkeren krijgt Sam gezondheidsproblemen waardoor hij een bijna-fataal ongeluk krijgt. Als hij hiervan herstelt krijgt hij zeer onverwachts bezoek. Samen met de bezoeker ontdekken ze een groot complot.

